import React from "react";
import { Modal, Frame } from "@react95/core";
//import ContentFactory from "./NotepadContent/ContentFactory";   <ContentFactory id={selectedItem.id} isMobile={isMobile} />

function Annons({ closeNotepad, selectedItem, isMobile }) {
  return (
    <Modal
      title="notepadd"
      closeModal={closeNotepad}
      buttons={[{ value: "Close", onClick: closeNotepad }]}
      style={{
        left: isMobile ? "5%" : "20%",
        top: isMobile ? "3%" : "15%",
        width: isMobile ? "90%" : 450,
      }}
    >
      <Frame
        bg="white"
        boxShadow="in"
        height="100%"
        padding={20}
        style={{
          overflowY: "auto",
          maxHeight: "60vh",
        }}
      >
        {" "}
        <p>Ta mig tillbaks igen</p>
      </Frame>
    </Modal>
  );
}

export default Annons;
